__NUXT_JSONP__("/drugs/Upifitamab", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:b,chebiId:b,chemicalFormula:b,definition:"A proprietary humanized monoclonal antibody against human sodium-dependent phosphate transport protein 2B (SLC34A2; NaPi2b), with potential antineoplastic activity. Upon administration of upifitamab, the antibody targets and binds to NaPi2b expressed on tumor cells. Although the tumor cell killing effects of XMT-1535 are not established, this binding may induce an antibody-dependent cellular cytotoxicity (ADCC)-mediated immune response against NaPi2b-expressing tumor cells, and\u002For may inhibit NaPi2b-mediated sodium and phosphate ion cotransport activity and ion-dependent tumor cell signaling. NaPi2b, a tumor-associated antigen (TAA), is overexpressed on a variety of tumor cells. It plays a key role in the transport of inorganic phosphate (Pi) and the maintenance of phosphate homeostasis.",fdaUniiCode:"15OY7NA275",identifier:"C147578",preferredName:a,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C20401"],synonyms:["Anti-NaPi2b MoAb XMT-1535","Anti-NaPi2b Monoclonal Antibody XMT-1535","MoAb XMT-1535","UPIFITAMAB",a,"XMT 1535","XMT-1535","XMT1535"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FUpifitamab",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Upifitamab","","2021-10-30T13:32:53.493Z")));